import {
  Button,
  Grid
} from "@mui/material";

const TestGri= ()=>{
  const design = (
    <>
      <Button variant="primary">BUTTON-1</Button>
      <Button variant="secondary">BUTTON-2</Button>
      <Button variant="info">BUTTON-3</Button>
    </>
  );
  return design;
}
export default TestGri;
